import React from 'react';
import {FormattedMessage} from 'react-intl';

const Footer = () => (

    <div class = "navbar-fixed-bottom">
        <br/>
        <hr/>
        <footer>
            <p className="text-center">
                <FormattedMessage id="project.app.Footer.text"/>
            </p>
        </footer>
    </div>

);

export default Footer;
